import { Component } from '@angular/core';

@Component({
  selector: 'app-modal',
  templateUrl: './modal.component.html',
  styleUrls: ['./modal.component.css']
})
export class ModalComponent {
  constructor(public theme: number) { this.Theme = theme; }
  public isOpen = false;
  public Theme = 0;

  public getTheme() {
    if (this.Theme === 1)
      return '';
    return '';
  }
}
